import Vue from "vue";
import VueRouter from "vue-router";

Vue.use(VueRouter);

const routes = [
  {
    path: "/login",
    name: "Login",
    component: () => import("../views/Login.vue"),
  },
  {
    path: "/alteracaoSenha/:matricula",
    name: "AlteracaoSenha",
    component: () => import("../views/AlteracaoSenha.vue"),
  },
  {
    path: "/alteracaoSenha",
    name: "AlteracaoSenhaEdit",
    component: () => import("../views/AlteracaoSenha.vue"),
  },
  {
    path: "/checkinLinha",
    name: "ChekingLinha",
    component: () => import("../views/Checkin/CkeckinLinha.vue"),
  },

  {
    path: "/",
    name: "Home",
    component: () => import("../views/Home.vue"),
    children: [
      {
        path: "/funcionarios",
        name: "Funcionario",
        component: () => import("../views/Cadastro/FuncionarioLista.vue"),
      },
      {
        path: "/funcionario",
        name: "Funcionario",
        component: () => import("../views/Cadastro/FuncionarioForm.vue"),
      },
      {
        path: "/funcionario/:id/:matricula",
        name: "FuncionarioEdit",
        component: () => import("../views/Cadastro/FuncionarioForm.vue"),
      },
      {
        path: "/categorias",
        name: "Categorias",
        component: () => import("../views/Cadastro/CategoriaLista.vue"),
      },
      {
        path: "/centrosCustos",
        name: "CentrosCustos",
        component: () => import("../views/Cadastro/CentroCustoLista.vue"),
      },
      {
        path: "/centroCusto/:codigo",
        name: "CentroCustoEdit",
        component: () => import("../views/Cadastro/CentroCustoForm.vue"),
      },
      {
        path: "/centroCusto",
        name: "CentroCusto",
        component: () => import("../views/Cadastro/CentroCustoForm.vue"),
      },
      {
        path: "/setores",
        name: "Setor",
        component: () => import("../views/Cadastro/SetorLista.vue"),
      },
      {
        path: "/setor/:id",
        name: "SetorEdit",
        component: () => import("../views/Cadastro/SetorForm.vue"),
      },
      {
        path: "/setor",
        name: "Setor",
        component: () => import("../views/Cadastro/SetorForm.vue"),
      },

      {
        path: "/perfils",
        name: "Perfils",
        component: () => import("../views/Acessos/PerfilLista.vue"),
      },
      {
        path: "/perfil/:id",
        name: "Perfil",
        component: () => import("../views/Acessos/PerfilForm.vue"),
      },
      {
        path: "/perfil",
        name: "PerfilEdit",
        component: () => import("../views/Acessos/PerfilForm.vue"),
      },
      {
        path: "/usuarios",
        name: "Usuarios",
        component: () => import("../views/Acessos/UsuarioLista.vue"),
      },
      {
        path: "/usuario/:id/:matricula",
        name: "UsuarioSave",
        component: () => import("../views/Acessos/UsuarioForm.vue"),
      },

      {
        path: "/usuario/:id/:matricula/:idUsuarioPerfil",
        name: "UsuarioEdit",
        component: () => import("../views/Acessos/UsuarioForm.vue"),
      },
      {
        path: "/espelhosPonto",
        name: "EspelhoPontos",
        component: () => import("../views/EspelhoPonto/EspelhoPontoLista.vue"),
      },
      {
        path: "/espelhoPonto/:matricula/:dtInicio/:dtFinal",
        name: "EspelhoPontoEdit",
        component: () => import("../views/EspelhoPonto/EspelhoPontoForm.vue"),
      },
      {
        path: "/fluxosAprovacao",
        name: "FluxosAprovacao",
        component: () => import("../views/FluxoAprovacao/FluxoAprovacaoLista.vue"),
      },
      {
        path: "/fluxoAprovacao",
        name: "FluxoAprovacao",
        component: () => import("../views/FluxoAprovacao/FluxoAprovacaoForm.vue"),
      },
      {
        path: "/fluxoAprovacao/:id",
        name: "FluxoAprovacaoView",
        component: () => import("../views/FluxoAprovacao/FluxoAprovacaoForm.vue"),
      },

      {
        path: "/absenteismo",
        name: "Absenteismo",
        component: () => import("../views/Absenteismo/AbsenteismoDashboard.vue"),
      },

      {
        path: "/calendario/",
        name: "CalendarioView",
        component: () => import("../views/Calendario/CalendarioLista.vue"),
      },
      {
        path: "/turnos",
        name: "Turnos",
        component: () => import("../views/Cadastro/TurnoListaForm.vue"),
      },
      {
        path: "/linhas",
        name: "Linhas",
        component: () => import("../views/Cadastro/LinhaLista.vue"),
      },
      {
        path: "/linha/:id",
        name: "LinhaEdit",
        component: () => import("../views/Cadastro/LinhaForm.vue"),
      },

      {
        path: "/linha",
        name: "Linha",
        component: () => import("../views/Cadastro/LinhaForm.vue"),
      },

      {
        path: "/produtos",
        name: "Produtos",
        component: () => import("../views/Cadastro/ProdutoLista.vue"),
      },
      {
        path: "/produto/:id",
        name: "Produto",
        component: () => import("../views/Cadastro/ProdutoForm.vue"),
      },
      {
        path: "/processos",
        name: "ProcessosNewEdit",
        component: () => import("../views/Cadastro/ProcessoListaForm.vue"),
      },
      {
        path: "/operadores",
        name: "Operadores",
        component: () => import("../views/Cadastro/OperadorLista.vue"),
      },
      {
        path: "/operador/:idFuncionario/:id",
        name: "Operador",
        component: () => import("../views/Cadastro/OperadorForm.vue"),
      },
      {
        path: "/operador/:idFuncionario",
        name: "operador",
        component: () => import("../views/Cadastro/OperadorForm.vue"),
      },
      {
        path: "/ordensProducao",
        name: "OrdensProducao",
        component: () => import("../views/OrdemProducao/OrdemProducaoLista.vue"),
      },
      {
        path: "/ordemProducao/:idOrdemProducaoLinha",
        name: "OrdemProducao",
        component: () => import("../views/OrdemProducao/OrdemProducaoForm.vue"),
      },
      {
        path: "/ordemProducao/:idOrdemProducaoLinha/:idOrdemProducaoPlano",
        name: "OrdemProducaoEdit",
        component: () => import("../views/OrdemProducao/OrdemProducaoForm.vue"),
      },
      {
        path: "/ordensProducaoListaSimulacao/:idOrdemProducao",
        name: "OrdensProducao",
        component: () => import("../views/OrdemProducao/OrdemProducaoListaSimulacao.vue"),
      },
      {
        path: "/linhascontrole",
        name: "LinhaControle",
        component: () => import("../views/Linha/LinhaControleLista.vue"),
      },
      {
        path: "/linhatransferencia",
        name: "LinhaTransferencia",
        component: () => import("../views/Linha/LinhaTransferenciaForm.vue"),
      },
      // {
      //   path: "/linhatroca",
      //   name: "LinhaTroca",
      //   component: () => import("../views/Linha/LinhaTrocaForm.vue"),
      // },
      // {
      //   path: "/linhaemprestimo",
      //   name: "LinhaEmprestimo",
      //   component: () => import("../views/Linha/LinhaEmprestimoForm.vue"),
      // }
    ],
  },
];

const router = new VueRouter({
  mode: "history",
  base: "/smartpoint/",
  //base: "/",
  routes,
});

export default router;
